"use strict";(self.webpackChunkcrux_study=self.webpackChunkcrux_study||[]).push([[6676],{8752:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"03-advanced-types","metadata":{"permalink":"/studyblog/blog/03-advanced-types","editUrl":"https://github.com/vdcruxfrontend/studyblog/tree/main/blog/chapter3.mdx","source":"@site/blog/chapter3.mdx","title":"3\uc7a5. \uace0\uae09 \ud0c0\uc785","description":"unknown","date":"2024-04-23T23:19:39.000Z","formattedDate":"2024\ub144 4\uc6d4 23\uc77c","tags":[{"label":"unknown","permalink":"/studyblog/blog/tags/unknown"},{"label":"enum","permalink":"/studyblog/blog/tags/enum"},{"label":"literal types","permalink":"/studyblog/blog/tags/literal-types"}],"readingTime":3.225,"hasTruncateMarker":false,"authors":[{"name":"\uc131\uc740\uc9c0","title":"Front End Engineer @VDCrux","url":"https://github.com/hotbreakb","imageURL":"https://github.com/hotbreakb.png","key":"hotbreakb"}],"frontMatter":{"slug":"03-advanced-types","title":"3\uc7a5. \uace0\uae09 \ud0c0\uc785","authors":["hotbreakb"],"tags":["unknown","enum","literal types"]},"unlisted":false,"nextItem":{"title":"4\uc7a5. \ud0c0\uc785 \ud655\uc7a5\ud558\uae30, \uc881\ud788\uae30","permalink":"/studyblog/blog/04-type-extends-guard"}},"content":"### unknown\\n\\n**\ud83d\udd0d \ub0b4\uc6a9 (85\ucabd)**\\n\\n- any \ud0c0\uc785\uacfc \uc720\uc0ac\ud558\uc9c0\ub9cc \ud0c0\uc785 \uac80\uc0ac\ub97c \uac15\uc81c\ud558\uace0 \ud0c0\uc785\uc774 \uc2dd\ubcc4\ub41c \ud6c4\uc5d0 \uc0ac\uc6a9\ub420 \uc218 \uc788\uae30 \ub54c\ubb38\uc5d0 any \ud0c0\uc785\ubcf4\ub2e4 \ub354 \uc548\uc804\ud558\ub2e4.\\n\\n**\ud83c\udf89 \uacb0\uacfc**\\n\\n- `any`\ubcf4\ub2e8 `unknown`\uc744 \uc0ac\uc6a9\ud558\uc5ec \uc5d0\ub7ec\ub97c \uc904\uc774\uc790.\\n\\n### enum\\n\\n**\ud83d\udd0d \ub0b4\uc6a9 (98\ucabd)**\\n\\n- \uc5f4\uac70\ud615\uc740 \ud0c0\uc785\uc2a4\ud06c\ub9bd\ud2b8 \ucf54\ub4dc\uac00 \uc790\ubc14\uc2a4\ud06c\ub9bd\ud2b8\ub85c \ubcc0\ud658\ub420 \ub54c \uc989\uc2dc \uc2e4\ud589 \ud568\uc218(IIFE) \ud615\uc2dd\uc73c\ub85c \ubcc0\ud658\ub418\ub294 \uac83\uc744 \ubcfc \uc218 \uc788\ub2e4.\\n- \uc774\ub54c \uc77c\ubd80 \ubc88\ub4e4\ub7ec\uc5d0\uc11c \ud2b8\ub9ac\uc250\uc774\ud0b9 \uacfc\uc815 \uc911 \uc989\uc2dc \uc2e4\ud589 \ud568\uc218\ub85c \ubcc0\ud658\ub41c \uac12\uc744 \uc0ac\uc6a9\ud558\uc9c0 \uc54a\ub294 \ucf54\ub4dc\ub85c \uc778\uc2dd\ud558\uc9c0 \ubabb\ud558\ub294 \uacbd\uc6b0\uac00 \ubc1c\uc0dd\ud560 \uc218 \uc788\ub2e4. \ub530\ub77c\uc11c \ubd88\ud544\uc694\ud55c \ucf54\ub4dc\uc758 \ud06c\uae30\uac00 \uc99d\uac00\ud558\ub294 \uacb0\uacfc\ub97c \ucd08\ub798\ud560 \uc218 \uc788\ub2e4. \uc774\ub7ec\ud55c \ubb38\uc81c\ub97c \ud574\uacb0\ud558\uae30 \uc704\ud574 \uc55e\uc11c \uc5b8\uae09\ud588\ub358 `const enum` \ub610\ub294 `as const` assertion\uc744 \uc0ac\uc6a9\ud574\uc11c \uc720\ub2c8\uc628 \ud0c0\uc785\uc73c\ub85c \uc5f4\uac70\ud615\uacfc \ub3d9\uc77c\ud55c \ud6a8\uacfc\ub97c \uc5bb\ub294 \ubc29\ubc95\uc774 \uc788\ub2e4.\\n- (enum \ub0b4\uc5d0\uc11c \uc22b\uc790\ub85c \uac12\uc774 \uc790\ub3d9 \ucd94\ub860\ub41c\ub2e4\ub294 \ub0b4\uc6a9 \ucd94\uac00)\\n\\n**\ud83c\udf89 \uacb0\uacfc**\\n\\n- \ud2b8\ub9ac\uc250\uc774\ud0b9 \uacfc\uc815 \uc911 \ubb38\uc81c\uac00 \ubc1c\uc0dd\ud560 \uc218 \uc788\ub294\ub370, \uc774\uac83\uc774 \uc131\ub2a5\uc5d0 \ub9c9\ub300\ud55c \uc601\ud5a5\uc744 \ubbf8\uce58\uc9c4 \uc54a\uc744 \uac83\uc774\ub2e4.\\n- `enum` \ub0b4\uc5d0\ub294 `string`\ub9cc \ub123\ub294 \uac83\uc73c\ub85c \ud55c\ub2e4.\\n- `enum`\uc744 \uc0ac\uc6a9\ud558\uc5ec `react-query` key\ub97c \uad00\ub9ac\ud574\ubcf4\uc790. `string` \uc624\ud0c8\uc790 \uc785\ub825\uc744 \ubc29\uc9c0\ud558\uace0 \uc911\ubcf5 \ud0a4\ub97c \uc0dd\uc131\ud558\ub294 \ubb38\uc81c\ub97c \ud574\uacb0\ud560 \uc218 \uc788\uc744 \uac83\uc774\ub2e4.\\n\\n### \ud15c\ud50c\ub9bf \ub9ac\ud130\ub7f4 \ud0c0\uc785(Template Literal Types)\\n\\n**\ud83d\udd0d \ub0b4\uc6a9 (105\ucabd)**\\n\\n```\\ntype Stage =\\n\\t| \\"init\\"\\n\\t| \\"select-image\\"\\n\\t| \\"edit-image\\";\\n\\ntype StageName = `${Stage}-stage`;\\n```\\n\\n**\ud83c\udf89 \uacb0\uacfc**\\n\\n- `redux` action\uc744 \ub9cc\ub4e4\uac70\ub098 `css` class name\uc744 \ub9cc\ub4e4 \ub54c \uc720\uc6a9\ud558\uac8c \uc0ac\uc6a9\ub41c\ub2e4.\\n\\n```tsx\\ntype Action = \\"increment\\" | \\"decrement\\";\\ntype ActionType = `${Action}_ACTION`;\\n```\\n\\n```tsx\\ntype ButtonType = \\"primary\\" | \\"secondary\\" | \\"danger\\";\\ntype ButtonClass = `btn-${ButtonType}`;\\n```\\n\\n### \uae30\ud0c0\\n\\n- `never`\ub97c \uc0ac\uc6a9\ud558\uc5ec \ud0c0\uc785\uc774 \ubc18\ud658\ub418\uc9c0 \uc54a\ub294 \uacbd\uc6b0\ub97c \ubd84\uba85\ud788 \ub098\ud0c0\ub0b4\uc790.\\n- \uc5ec\ub7ec \uba85\uc774 \ud558\ub098\uc758 \ud30c\uc77c\uc744 \ub3d9\uc2dc\uc5d0 \uc218\uc815\ud560 \uac83\uc744 \uace0\ub824\ud558\uc5ec \ud568\uc218\uba85\uc774 \ubc14\ub014 \ub54c\ub294 [`@deprecated`](https://jsdoc.app/tags-deprecated)\ub85c \ud45c\uae30\ud558\uace0 \ud30c\uc77c\uc744 \uc9c0\uc6b0\uc9c0 \ub9d0\uc790.\\n- `extends`\ub294 \ud655\uc7a5\uc758 \uac1c\ub150\ub3c4 \uc788\uc9c0\ub9cc, \ucd94\ub860\ud55c\ub2e4\ub294 \ub73b\uc744 \uac00\uc9c0\uace0 \uc788\ub2e4. \ub530\ub77c\uc11c `T extends true`\ub294 `\ucc38\uc774\ub77c\uba74`\uc774\ub77c\ub294 \ub73b\uc774 \uc788\ub2e4.\\n- \uc791\uc740 \ud0c0\uc785\uc744 [Union Type](https://www.typescriptlang.org/docs/handbook/unions-and-intersections.html#union-types)\uc774\ub098 [Intersection Type](https://www.typescriptlang.org/docs/handbook/unions-and-intersections.html#intersection-types)\uc73c\ub85c \ubb36\uc5b4\uc11c \uc0ac\uc6a9\ud558\uc790. `Pick`\uc774\ub098 `Omit`\uc744 \uc4f0\uba74 \uc5b4\ub5a4 \uac12\uc774 \ub4e4\uc5b4\uac00\uace0 \ub098\uac00\ub294\uc9c0 \uba38\ub9bf\uc18d\uc73c\ub85c \uacc4\uc0b0\ud574\uc57c \ud558\uae30 \ub54c\ubb38\uc5d0 \uac00\ub3c5\uc131\uc774 \ub5a8\uc5b4\uc9c4\ub2e4.\\n- `?` \uc5f0\uc0b0\uc790\ub85c \ud0c0\uc785\uc744 \ub9cc\ub4dc\ub294 \ub300\uc2e0 [`Partial`](https://www.typescriptlang.org/docs/handbook/utility-types.html#partialtype)\uc744 \uc4f0\uc790."},{"id":"04-type-extends-guard","metadata":{"permalink":"/studyblog/blog/04-type-extends-guard","editUrl":"https://github.com/vdcruxfrontend/studyblog/tree/main/blog/chapter4.mdx","source":"@site/blog/chapter4.mdx","title":"4\uc7a5. \ud0c0\uc785 \ud655\uc7a5\ud558\uae30, \uc881\ud788\uae30","description":"\ud0c0\uc785 \ud655\uc7a5\uc758 \uc7a5\uc810\uacfc \ub354\ubd88\uc5b4 extends, \uad50\ucc28 \ud0c0\uc785, \uc720\ub2c8\uc628 \ud0c0\uc785\uac04\uc758 \ucc28\uc774\ub97c \ud30c\uc545\ud558\uace0 \uc5b8\uc81c \uc0ac\uc6a9\ud558\uba74 \uc88b\uc744\uc9c0 \uc0b4\ud3b4\ubcf4\uc790.","date":"2024-04-23T23:19:39.000Z","formattedDate":"2024\ub144 4\uc6d4 23\uc77c","tags":[{"label":"extends","permalink":"/studyblog/blog/tags/extends"},{"label":"guard","permalink":"/studyblog/blog/tags/guard"}],"readingTime":11.655,"hasTruncateMarker":false,"authors":[{"name":"\uace0\ud604\uc218","title":"Front End Engineer @VDCrux","url":"https://github.com/movie42","imageURL":"https://github.com/movie42.png","key":"hyunsu"}],"frontMatter":{"slug":"04-type-extends-guard","title":"4\uc7a5. \ud0c0\uc785 \ud655\uc7a5\ud558\uae30, \uc881\ud788\uae30","authors":["hyunsu"],"tags":["extends","guard"]},"unlisted":false,"prevItem":{"title":"3\uc7a5. \uace0\uae09 \ud0c0\uc785","permalink":"/studyblog/blog/03-advanced-types"},"nextItem":{"title":"5\uc7a5. \ud0c0\uc785 \ud65c\uc6a9\ud558\uae30","permalink":"/studyblog/blog/05-makeing-good-use-of-types"}},"content":"> \ud0c0\uc785 \ud655\uc7a5\uc758 \uc7a5\uc810\uacfc \ub354\ubd88\uc5b4 extends, \uad50\ucc28 \ud0c0\uc785, \uc720\ub2c8\uc628 \ud0c0\uc785\uac04\uc758 \ucc28\uc774\ub97c \ud30c\uc545\ud558\uace0 \uc5b8\uc81c \uc0ac\uc6a9\ud558\uba74 \uc88b\uc744\uc9c0 \uc0b4\ud3b4\ubcf4\uc790.  \\n> \ubcf8\ubb38 p.120\\n\\n## \ud0c0\uc785 \ud655\uc7a5\ud558\uae30\\n\\n### \ud0c0\uc785 \ud655\uc7a5\uc758 \uc7a5\uc810\\n\\n- \ucf54\ub4dc \uc911\ubcf5\uc744 \uc904\uc77c \uc218 \uc788\ub2e4.\\n  - DRY(Don\'t Repeat Yourself)\ub294 \ud0c0\uc785\uc5d0\uc11c\ub3c4 \uc801\uc6a9\ub41c\ub2e4.\\n- \uba85\uc2dc\uc801\uc778 \ucf54\ub4dc\ub97c \uc791\uc131\ud560 \uc218 \uc788\ub2e4.(\uc5b4\ub514\uc5d0\uc11c \ud655\uc7a5 \ub418\uc5c8\ub2e4\ub294 \uac83\uc744 \uc27d\uac8c \ud655\uc778 \uac00\ub2a5\ud558\ub2e4.)\\n- \ucf54\ub4dc \uc791\uc131 \ub2e8\uacc4\uc5d0\uc11c \uc608\uae30\uce58 \ubabb\ud55c \ubc84\uadf8\ub3c4 \uc608\ubc29 \uac00\ub2a5\ud558\ub2e4.\\n\\n- \uc608\uc2dc\\n\\n  - interface\uc5d0\uc11c \ud655\uc7a5\\n\\n    ```ts\\n    interface Table {\\n      id: number;\\n      name: string;\\n      coordinate: string;\\n      dimension: string;\\n    }\\n\\n    interface ModifyTable extends Table {\\n      color?: string;\\n    }\\n    ```\\n\\n  - type\uc744 \ud65c\uc6a9\ud55c \ud655\uc7a5\\n\\n    ```ts\\n    type Table = {\\n      id: number;\\n      name: string;\\n      coordinate: string;\\n      dimension: string;\\n    };\\n\\n    type ModifyTable = {\\n      color?: string;\\n    } & Table;\\n    ```\\n\\n- \ud0c0\uc785 \ud655\uc7a5\uc740 \ud655\uc7a5\uc131\uc774\ub77c\ub294 \uc7a5\uc810\uc744 \uac00\uc9c4\ub2e4.\\n\\n  - \uc5ec\ub7ec \ud0c0\uc785\uc73c\ub85c \ud655\uc7a5 \uac00\ub2a5\\n\\n    ```ts\\n    interface Table {\\n      id: number;\\n      name: string;\\n      coordinate: string;\\n      dimension: string;\\n    }\\n\\n    interface ModifyTable extends Table {\\n      color?: string;\\n    }\\n\\n    interface CheckConnectTable extends Table {\\n      connect?: boolean;\\n      occupy?: boolean;\\n    }\\n    ```\\n\\n## \uc720\ub2c8\uc628 \ud0c0\uc785 (Union Type)\\n\\n> \uc720\ub2c8\uc628 \ud0c0\uc785\uc740 2\uac1c \uc774\uc0c1\uc758 \ud0c0\uc785\uc744 \uc870\ud569\ud558\uc5ec \uc0ac\uc6a9\ud558\ub294 \ubc29\ubc95\uc774\ub2e4. \uc9d1\ud569\uc758 \uad00\uc810\uc73c\ub85c \ubcf4\uba74 \uc720\ub2c8\uc628 \ud0c0\uc785\uc744 \ud569\uc9d1\ud569\uc73c\ub85c \ud574\uc11d\ud560 \uc218 \uc788\ub2e4.  \\n> p.122\\n\\n```ts\\ntype Union = A | B;\\n```\\n\\n\uc720\ub2c8\uc628 \ud0c0\uc785\uc73c\ub85c \uc120\uc5b8\ub41c \uac12\uc740 \uc720\ub2c8\uc628 \ud0c0\uc785\uc5d0 \ud3ec\ud568\ub41c \ubaa8\ub4e0 \ud0c0\uc785\uc774 \uacf5\ud1b5\uc73c\ub85c \uac16\uace0\uc788\ub294 \uc18d\uc131\uc5d0\ub9cc \uc811\uadfc\ud560 \uc218 \uc788\ub2e4.\\n\\n[\uc608\uc81c](https://www.typescriptlang.org/play?#code/JYOwLgpgTgZghgYwgAgBIFcC2cTIN4BQyywAJgFzIDOYUoA5gNxHIhyYTk10hMtz1OrLACNozAL4FQkWIhQZsIAPZl8LMpW4NmxNhy60dLBFAhxIpAIJgtR3pIIEY6EAjDBluQWCuCAFMoiAFYQ7pSKOMgAPmhYOKqkAJSExGZg6FC4QaHuAHQCEJJAA)\\n\\n```ts\\ninterface Human {\\n  name: string;\\n  age: number;\\n}\\n\\ninterface Humanoid {\\n  id: string;\\n  createdAt: string;\\n}\\n\\nfunction getAge(object: Human | Humanoid) {\\n  return object.age;\\n  // Property \'age\' does not exist on type \'Human | Humanoid\'.\\n  // Property \'age\' does not exist on type \'Humanoid\'.\\n}\\n```\\n\\n## \uad50\ucc28 \ud0c0\uc785(Intersection Type)\\n\\n> \uad50\ucc28 \ud0c0\uc785\uc740 \uad50\uc9d1\ud569\uc758 \uac1c\ub150\uacfc \ube44\uc2b7\ud558\ub2e4.  \\n> p.124\\n\\n```ts\\ntype Intersection = A & B;\\n```\\n\\n[\uc608\uc81c](https://www.typescriptlang.org/play?#code/JYOwLgpgTgZghgYwgAgBIFcC2cTIN4BQyywAJgFzIDOYUoA5gNxHIhyYSU10hMtz1OrLACNozAL4ECoSLEQoM2EAHsy+FmS60GzYmw7aefYgigQ4kUgEEwR3QSkEwATwAOKAHIQA7gHUVKAAbUgAFCBU3IJQAXjQsHGQAMnjlNVJmAhh0EAQwYBVcQTBrQQAKFREAKwg8ym9-QJDwyOiASg1iczB0KFxKmryAOgEISSA)\\n\\n```ts\\ninterface Human {\\n  name: string;\\n  age: number;\\n}\\n\\ninterface Humanoid {\\n  id: string;\\n  createdAt: string;\\n}\\n\\ntype NewWorldPeople = Human & Humanoid;\\n\\nfunction getAge(object: NewWorldPeople) {\\n  return object.age;\\n}\\n```\\n\\n### \ud83d\udca1\uad81\uae08\ud558\ub2e4 \uad81\uae08\ud574!\\n\\n\ucc45\uc758 \ubcf8\ubb38\uc5d0\ub294 \uc720\ub2c8\uc628 \ud0c0\uc785\uacfc \uad50\ucc28 \ud0c0\uc785\uc5d0 \ub300\ud574\uc11c \uc774\ub807\uac8c \uc124\uba85\ud558\uace0 \uc788\ub2e4.\\n\\n> \ud0c0\uc785\uc2a4\ud06c\ub9bd\ud2b8\uc758 \ud0c0\uc785\uc744 \uc18d\uc131\uc758 \uc9d1\ud569\uc774 \uc544\ub2c8\ub77c \uac12\uc758 \uc9d1\ud569\uc774\ub77c\uace0 \uc0dd\uac01\ud574\uc57c \uc720\ub2c8\uc628 \ud0c0\uc785\uc774 \ud569\uc9d1\ud569\uc774\ub77c\ub294 \uac1c\ub150\uc744 \uc774\ud574\ud560 \uc218 \uc788\ub2e4.  \\n> p.123\\n\\n\ucc45\uc5d0\uc11c\ub294 \uc18d\uc131\uc774 \uc544\ub2cc \uac12\uc758 \uc9d1\ud569\uc774\ub77c\uace0 \uc0dd\uac01\ud574\uc57c\ud55c\ub2e4\uace0 \uac15\uc870\ud55c\ub2e4.(\ub450 \ubc88) \ud558\uc9c0\ub9cc \uc5b4\uca0c\ub4e0 \uc9c1\uad00\uc801\uc73c\ub85c \ub3d9\uc791\ud558\uace0 \uc788\ub294 \ubaa8\uc2b5\uc740 Union \ud0c0\uc785\uc740 \uad50\uc9d1\ud569\ucc98\ub7fc \ub3d9\uc791\ud558\uace0 Intersection \ud0c0\uc785\uc740 \ud569\uc9d1\ud569 \ucc98\ub7fc \ub290\uaef4\uc9c4\ub2e4.\\n\uc704\uc5d0\uc11c \ub4e4\uc5c8\ub358 \uc608\uc81c\ub4e4\uc744 \ubcf4\uba74 \ud569\uc9d1\ud569\uc774\ub77c\ub2c8\uae4c \ub2f9\uc5f0\uc2a4\ub808 object\uc5d0 age\uac00 \uc788\uc744 \uac83\uc73c\ub85c \uc0dd\uac01\ub41c\ub2e4. \ud558\uc9c0\ub9cc \uadf8\ub807\uc9c0 \uc54a\ub2e4. \ub3c4\ub300\uccb4 \uc65c\uc774\ub7ec\ub294 \uac78\uae4c?\\n\\nstackOverflow\uc5d0 \ub098\uc640 \ub611\uac19\uc740 \uc0dd\uac01\uc744 \ud574\uc11c \uc9c8\ubb38\uc744 \uc62c\ub9b0 \uc0ac\ub78c\uc774 \uc788\ub294\ub370 \uc815\ub9d0 \uc5ec\ub7ec \ub2f5\ubcc0\ub4e4\uc774 \ub2ec\ub838\uace0 \ub0b4\uac00 \uc81c\uc77c \ub3c4\uc6c0\uc774 \ub410\ub358 \ub2f5\ubcc0\uc758 \ub9c1\ud06c\ub97c \ucca8\ubd80\ud55c\ub2e4.\\n\\n- [Naming of TypeScript union and intersection types - Kai Roesner answered](https://stackoverflow.com/a/61733065)\\n\\n\uc774 \ubd84\uc758 \ub2f5\ubcc0\uc740 \ucc45\uc5d0 \uc801\ud600\uc788\ub294 \uc18d\uc131\uc758 \uc9d1\ud569\uc774 \uc544\ub2cc \uac12\uc758 \uc9d1\ud569\uc774\ub77c\uace0 \uc0dd\uac01\ud574\uc57c\ud55c\ub2e4\ub294 \uac83\uc758 \uc758\ubbf8\ub97c \uc798 \uc124\uba85\ud574\uc8fc\uace0 \uc788\ub2e4.\\n\uc704\uc758 Human\uacfc Humanoid\ub97c \uc18d\uc131\uc774 \uc544\ub2cc \uac12\uc758 \uad00\uc810\uc5d0\uc11c Union\uacfc Intersection\uc744 \uc124\uba85\ud560 \uc218 \uc788\ub2e4.\\n\\n- Union : Human\uc758 \uac12\ub3c4 \ub418\uace0 Humanoid\uc758 \uac12\ub3c4 \ub41c\ub2e4. \uadf8\ub9ac\uace0 Human\uacfc Humanoid\uac00 \ud569\uccd0\uc9c4 NewWorldPeople\uc758 \uac12\ub3c4 \ub41c\ub2e4.\\n- Intersection : \uc624\uc9c1 NewWorldPeople\ub9cc \ub41c\ub2e4.\\n\\n[\ub2f5\ubcc0\uc758 \uc608\uc2dc](https://www.typescriptlang.org/play?#code/C4TwDgpgBAglC8UDeAoKUAeAuKA7ArgLYBGEATmlCDgSeSgL4oqiRQBCCyl1eRpFdAC8a-ekxbhoASS5wAZB0lsAqnKgAfJSgA2EYFACWOabv1R8OFc0NckmHAEYANFRwAmKAwDc6P-4B6AKgAHgBaKHIyAHsKW0R7XndXESgAZi9ff0Dg8MiyGLi7BygXNyhkqFSMn2Z8YuxS1yTMlHqE8srq1vbkErKklJwa7xQgA)\uc911 \ud558\ub098\ub97c \uc778\uc6a9\ud558\uace0\uc790\ud55c\ub2e4.\\n\\n```ts\\ntype A = {\\n  x: number;\\n  y: number;\\n};\\n\\ntype B = {\\n  y: number;\\n  z: number;\\n};\\n\\ntype I = A & B;\\ntype U = A | B;\\n\\nlet i: I;\\nlet u: U;\\n\\ni = { x: 1, y: 2 }; // <- error\\ni = { y: 2, z: 3 }; // <- error\\ni = { x: 1, y: 2, z: 3 };\\n\\nu = { x: 1, y: 2 };\\nu = { y: 2, z: 3 };\\nu = { x: 1, y: 2, z: 3 };\\n```\\n\\n## \ud0c0\uc785 \uc881\ud788\uae30 - \ud0c0\uc785\uac00\ub4dc\\n\\n\ud0c0\uc785 \uac00\ub4dc\ub294 \ud06c\uac8c \uc790\ubc14\uc2a4\ud06c\ub9bd\ud2b8 \uc5f0\uc0b0\uc790\ub97c \uc0ac\uc6a9\ud55c \ud0c0\uc785 \uac00\ub4dc\uc640 \uc0ac\uc6a9\uc790 \uc815\uc758 \ud0c0\uc785 \uac00\ub4dc\ub85c \uad6c\ubd84\ud560 \uc218 \uc788\ub2e4.\\n\\n1. \uc6d0\uc2dc \ud0c0\uc785\uc744 \ucd94\ub860\ud560 \ub54c : typeof \uc5f0\uc0b0\uc790 \ud65c\uc6a9\ud558\uae30\\n2. \uc778\uc2a4\ud134\uc2a4\ud654\ub41c \uac1d\uccb4 \ud0c0\uc785\uc744 \ud310\ubcc4\ud560 \ub54c : instanceof \uc5f0\uc0b0\uc790 \ud65c\uc6a9\ud558\uae30\\n3. \uac1d\uccb4\uc758 \uc18d\uc131\uc774 \uc788\ub294\uc9c0 \uc5c6\ub294\uc9c0\uc5d0 \ub530\ub978 \uad6c\ubd84 : in \uc5f0\uc0b0\uc790 \ud65c\uc6a9\ud558\uae30\\n4. is \uc5f0\uc0b0\uc790\ub85c \uc0ac\uc6a9\uc790 \uc815\uc758 \ud0c0\uc785 \uac00\ub4dc \ub9cc\ub4e4\uc5b4 \ud65c\uc6a9\ud558\uae30\\n\\n\uc790\uc138\ud55c \ub0b4\uc6a9\uc740 \ucc45\uc744 \ucc38\uc870\ud558\uae30.\\n\\n## \ud0c0\uc785 \uc881\ud788\uae30 - \uc2dd\ubcc4\ud560 \uc218 \uc788\ub294 \uc720\ub2c8\uc628\\n\\n> \uc885\uc885 \ud0dc\uadf8\ub41c \uc720\ub2c8\uc628\uc73c\ub85c\ub3c4 \ubd88\ub9ac\uc6b0\ub294 \uc2dd\ubcc4\ud560 \uc218 \uc788\ub294 \uc720\ub2c8\uc628\uc740 \ud0c0\uc785 \uc881\ud788\uae30\uc5d0 \ub110\ub9ac \uc0ac\uc6a9\ub418\ub294 \ubc29\uc2dd\uc774\ub2e4.  \\n> p.139\\n\\n\uc774 \uc608\uc2dc\ub294 \ubcf8\ubb38\uc758 \uc608\uc2dc\ub97c \uadf8\ub300\ub85c \uc778\uc6a9\ud55c\ub2e4. \uc65c\ub0d0\ud558\uba74 \uc6b0\ub9ac \ucf54\ub4dc\uc5d0\ub3c4 \uc774\uc640 \uac19\uc740 \uc5d0\ub7ec \ucc98\ub9ac \ubc29\uc2dd\uc774 \ub611\uac19\uc774 \uc801\uc6a9 \ub420 \uc218 \uc788\uae30 \ub54c\ubb38\uc774\ub2e4.\\n\\n```ts\\ntype TextError = {\\n  errorCode: string;\\n  errorMessage: string;\\n};\\ntype ToastError = {\\n  errorCode: string;\\n  errorMessage: string;\\n  toastShowDuration: number;\\n};\\ntype AlertError = {\\n  errorCode: string;\\n  errorMessage: string;\\n  onConfirm: () => void;\\n};\\n\\ntype ErrorFeedbackType = TextError | ToastError | AlertError;\\nconst errorArr: ErrorFeedbackType[] = [\\n  { errorCode: \\"100\\", errorMessage: \\"\ud14d\uc2a4\ud2b8 \uc5d0\ub7ec\\" },\\n  { errorCode: \\"200\\", errorMessage: \\"\ud1a0\uc2a4\ud2b8 \uc5d0\ub7ec\\", toastShowDuration: 3000 },\\n  { errorCode: \\"300\\", errorMessage: \\"\uc5bc\ub7ff \uc5d0\ub7ec\\", onConfirm: () => {} },\\n  {\\n    errorCode: \\"999\\",\\n    errorMessage: \\"\uc798\ubabb\ub41c \uc5d0\ub7ec\\",\\n    onConfirm: () => {},\\n    toastShowDuration: 3000\\n  } // expect error\\n];\\n```\\n\\n\ud0c0\uc785\uc744 \uc774\ub807\uac8c \uac70\ucc3d\ud558\uac8c \uc791\uc131\ud55c \uc774\uc720\ub294 \uc544\ub9c8\ub3c4 errorCode 999\ub97c \uac00\uc9c0\ub294 \uc800 \uac1d\uccb4\uc5d0 \ub300\ud574\uc11c \uc5d0\ub7ec\ub97c \uae30\ub300\ud588\uae30 \ub54c\ubb38\uc77c \uac83\uc774\ub2e4.\\n\uadf8\ub7ec\ub098 \uc774\ub7f0 \uc0c1\ud669\uc5d0\uc11c \uc790\ubc14\uc2a4\ud06c\ub9bd\ud2b8\ub294 \ub355 \ud0c0\uc774\ud551 \uc5b8\uc5b4\uc774\uae30 \ub54c\ubb38\uc5d0 \ubcc4\ub3c4\uc758 \ud0c0\uc785 \uc5d0\ub7ec\ub97c \ubc49\uc9c0 \uc54a\ub294\ub2e4.\\n\\n### \uc2dd\ubcc4\ud560 \uc218 \uc788\ub294 \uc720\ub2c8\uc628\\n\\n> \uac01 \ud0c0\uc785\uc774 \ube44\uc2b7\ud55c \uad6c\uc870\ub97c \uac00\uc9c0\uc9c0\ub9cc \uc11c\ub85c \ud638\ud658\ub418\uc9c0 \uc54a\ub3c4\ub85d \ub9cc\ub4e4\uc5b4 \uc8fc\uae30 \uc704\ud574\uc11c\ub294 \uc11c\ub85c \ud3ec\ud568 \uad00\uacc4\ub97c \uac00\uc9c0\uc9c0 \uc54a\ub3c4\ub85d \uc815\uc758\ud574\uc57c\ud55c\ub2e4.  \\n> \uc2dd\ubcc4\ud560 \uc218 \uc788\ub294 \uc720\ub2c8\uc628\uc774\ub780 \ud0c0\uc785 \uac04\uc758 \uad6c\uc870 \ud638\ud658\uc744 \ub9c9\uae30 \uc704\ud574 \ud0c0\uc785\ub9c8\ub2e4 \uad6c\ubd84\ud560 \uc218 \uc788\ub294 \ud310\ubcc4\uc790\ub97c \ub2ec\uc544\uc8fc\uc5b4 \uad00\uacc4\ub97c \uc81c\uac70\ud558\ub294 \uac83\uc774\ub2e4.\\n\\n[\uc608\uc81c](https://www.typescriptlang.org/play?ssl=32&ssc=3&pln=7&pc=1#-vEkmkMlkcjQAMx0mlCkXEXHNey0DrdKV4mUOc30xnBFTjWWAHtHAP-tWqVsxyi2Wa022B2eD0VpxHBGdlaROYDIT0spdAAnDm08RE0pvSy6IAM8cA3V2AHBag9b8yGFksVlANtt8ML07rYgkUulMtlclB3TSOLGAPQjkjwSAPYDkgjo1hAA)\\n\\n```ts\\ntype TextError = {\\n  errorType: \\"TEXT\\";\\n  errorCode: string;\\n  errorMessage: string;\\n};\\ntype ToastError = {\\n  errorType: \\"TOAST\\";\\n  errorCode: string;\\n  errorMessage: string;\\n  toastShowDuration: number;\\n};\\ntype AlertError = {\\n  errorType: \\"ALERT\\";\\n  errorCode: string;\\n  errorMessage: string;\\n  onConfirm: () => void;\\n};\\n```\\n\\n\uc774\ub807\uac8c \uc218\uc815\ud558\uba74 errorArr\uc5d0 errorType\uc774 \ud3ec\ud568\ub418\uc5b4 \uc790\ubc14\uc2a4\ud06c\ub9bd\ud2b8\uac00 errorCode 999\ub97c \uac00\uc9c4 \uac1d\uccb4\uc5d0 \ub300\ud574 \uc5d0\ub7ec\ub97c \ubc18\ud658\ud55c\ub2e4.\\n\\n```ts\\n  // (\uc0dd\ub7b5)\\n  {\\n    type:\\"TEXT\\",\\n    errorCode: \\"999\\",\\n    errorMessage: \\"\uc798\ubabb\ub41c \uc5d0\ub7ec\\",\\n    onConfirm: () => {},\\n    toastShowDuration: 3000\\n  }\\n];\\n\\n// Object literal may only specify known properties, and \'onConfirm\' does not exist in type \'TextError\'.\\n```\\n\\n### \ud310\ubcc4\uc790 \uc120\uc815\\n\\n- \ub9ac\ud130\ub7f4 \ud0c0\uc785\uc774\uc5b4\uc57c\ud55c\ub2e4.\\n- \uc778\uc2a4\ud134\uc2a4\ud654\ud560 \uc218 \uc788\ub294 \ud0c0\uc785\uc740 \ud3ec\ud568\ub418\uc9c0 \uc54a\uc544\uc57c\ud55c\ub2e4.\\n\\n## Exhaustiveness Checking\\n\\nnever \ud65c\uc6a9\uc5d0 \ud754\uce58 \uc54a\uc740 \uc608\uc81c\ub77c \uc815\ub9ac\ud574\ubd24\ub2e4.\\n\\n> \ubaa8\ub4e0 \ud0c0\uc785\uc5d0 \ub300\ud55c \ud0c0\uc785 \uac80\uc0ac\ub97c \uac15\uc81c\ud558\uace0 \uc2f6\ub2e4\uba74 \ub2e4\uc74c\uacfc \uac19\uc774 \ucf54\ub4dc\ub97c \uc791\uc131\ud558\uba74 \ub41c\ub2e4.  \\n> p.146-147\\n\\n[\uc608\uc81c](https://www.typescriptlang.org/play?#code/C4TwDgpgBACgTgewCYFcDGx4Es3QLxQBEAjAAzmmFQA+RATBZTUQKwWEDcAUF2ggHYBnYFADmETIlQYAcgEMAtvigAKMFPSScEAFywNGbLgCUe4XCz9RUPAD4oAby5QoWAGar1yTUfx4CJIyExlBwEihw-ESADD2AP92AgwOAESuAMbVQxIAznVCAC2Oczq4eagZauDb+9EEhYcARUYRxSal0mTncLgD0bfmF3oYWJf4BbOTBoeGRMQkpUCyAOTPZhHkQADaC0E4uLhAAHgAWcijCWABuEADCOxBoANbd0sUQxq0bVTUTDbkuAL5cn9y8AsIoNs9gdgMczhdrjZPHI4Io9PwICc4CE7I48sAdogAO5QRG4gCicEQcBUhFAkCBxIQcAAhMFuL8gA)\\n\\n```ts\\ntype ProductPrice = \\"10000\\" | \\"20000\\" | \\"5000\\";\\n\\nconst getProductName = (productPrice: ProductPrice): string => {\\n  if (productPrice === \\"10000\\") return \\"\ubc30\ubbfc\uc0c1\ud488\uad8c 1\ub9cc \uc6d0\\";\\n  if (productPrice === \\"20000\\") return \\"\ubc30\ubbfc\uc0c1\ud488\uad8c 2\ub9cc \uc6d0\\";\\n  // if(productPrice === \\"5000\\") return \\"\ubc30\ubbfc\uc0c1\ud488\uad8c 5\ucc9c \uc6d0\\"\\n  else {\\n    exhaustiveCheck(productPrice);\\n    // Argument of type \'string\' is not assignable to parameter of type \'never\'.\\n    // \'param\' is declared but its value is never read.\\n    return \\"\ubc30\ubbfc\uc0c1\ud488\uad8c\\";\\n  }\\n};\\n\\nconst exhaustiveCheck = (param: never) => {\\n  throw new Error(\\"type error!\\");\\n};\\n```\\n\\n## \ub9c8\ubb34\ub9ac\\n\\n\ud0c0\uc785\uc744 \uc9d1\ud569\uc73c\ub85c\uc368\uc758 \uac1c\ub150\uc73c\ub85c \uc124\uba85\ud558\ub294 \uac83\uc774 \uc0ac\uc2e4 \uc774\ud574\uac00 \uc798 \uc548\ub410\uc5c8\ub2e4. \ud558\uc9c0\ub9cc \'\uc18d\uc131\'\uc774 \uc544\ub2cc \'\uac12\'\uc774\ub77c\ub294 \uac1c\ub150\uacfc \uadf8\uac83\uc744 \uc2e4\ub9c8\ub9ac \uc0bc\uc544\\n\ub098\ub984\ub300\ub85c \uc774\ud574\ub97c \ud560 \uc218 \uc788\uc5c8\ub2e4. \ud569\uc9d1\ud569\uacfc \uad50\uc9d1\ud569\uc740 \uac12\uc73c\ub85c\uc368\uc758 \ud569\uc9d1\ud569\uacfc \uad50\uc9d1\ud569\uc758 \uac1c\ub150\uc774\ub2e4. \ucca8\ubd80\ud55c stackoverflow\uc758 \ub9c1\ud06c\uc5d0\\n\uc790\uae30 \uc2a4\uc2a4\ub85c \uc774\ud574\uac00 \uc798 \ub418\ub294 \ub2f5\ubcc0\uc744 \ucc44\ud0dd\ud574\uc11c \ub2e4\ub978 \uc0ac\ub78c\uc5d0\uac8c \uc124\uba85\ud560 \uc218 \uc788\uc73c\uba74 \ub420 \uac83 \uac19\ub2e4.\\n\\n\ud0c0\uc785 \uc881\ud788\uae30\ub294 instanceof\ub098 if\ubb38\uc73c\ub85c \uac12\uc774 \uc788\ub294\uc9c0 \uc5c6\ub294\uc9c0 \uccb4\ud06c\ud574\uc11c \ub9c9\ub294 \uac83\uc774\uc5c8\ub294\ub370 typeof\ub098 in, is\uc640 \uac19\uc740 \uc790\ubc14\uc2a4\ud06c\ub9bd\ud2b8 \uc5f0\uc0b0\uc790\ub97c \ud65c\uc6a9\ud55c\\n\ud0c0\uc785 \uac00\ub4dc\uac00 \uc788\ub2e4\ub294 \uc0ac\uc2e4\uc744 \uc0c8\ub86d\uac8c \ubc30\uc6b0\uac8c \ub418\uc5c8\ub2e4.\\n\uc2dd\ubcc4\ud560 \uc218 \uc788\ub294 \uc720\ub2c8\uc628\uc740 \'\uc774\ud399\ud2f0\ube0c \ud0c0\uc785\uc2a4\ud06c\ub9bd\ud2b8\'\uc5d0\uc11c \ubcf8 \uac1c\ub150\uc774\uc9c0\ub9cc \uc2e4\ubb34\uc5d0\uc120 \ud65c\uc6a9\ud558\uc9c0 \ubabb\ud588\uc5c8\uc2b5\ub2c8\ub2e4. \uadf8\ub7ec\ub098 Error \uc608\uc81c\ub97c \ubcf4\uace0 \ub098\ub2c8 \ud68c\uc0ac\uc758 \ucf54\ub4dc\uc5d0 \uc801\uc6a9\ud574 \ubcfc \uc218 \uc788\uc744 \uac83 \uac19\ub2e4\ub294 \uc0dd\uac01\uc774 \ub4e4\uc5c8\ub2e4.\\n\\n\ub9c8\uc9c0\ub9c9\uc73c\ub85c never\ub294 \ubcc4\ub85c \uc2e4\uc6a9\uc801\uc774\uac70\ub098 \ud65c\uc6a9\ud560 \uc77c\uc774 \uc5c6\ub2e4\uace0 \uc0dd\uac01\ud588\ub294\ub370 \ucc55\ud130 \ub9c8\uc9c0\ub9c9\uc5d0 \uc18c\uac1c\ub41c exhaustiveCheck\ub97c never\ub97c\\n\ud65c\uc6a9\ud558\uae30\ub3c4 \ud558\ub294\uad6c\ub098 \ud558\ub294 \uc0dd\uac01\uc774 \ub4e4\uc5c8\ub2e4. \uc608\uc804\uc5d0 Toast UI blog\uc5d0\uc11c [\ud0c0\uc785\uc2a4\ud06c\ub9bd\ud2b8\uc758 Never \ud0c0\uc785 \uc644\ubcbd \uac00\uc774\ub4dc](https://ui.toast.com/posts/ko_20220323)\ub77c\ub294 \uae00\uc744 \uc77d\uc5c8\ub358 \uc801\uc774 \uc788\ub294\ub370,\\n\uc0ac\uc2e4 \uc774\uac8c \ubb50\uc9c0? \ub77c\ub294 \uc0dd\uac01\uc774 \ub4e4\uc5c8\uc9c0\ub9cc \uc774\ubc88\uc5d0 \uc2e4\uc6a9\uc801\uc778 \uc4f0\uc784\uc138\ub97c \uc54c\uac8c\ub418\uc5c8\ub2e4. \ucc45\uc744 \ub2e4 \uc77d\uc5c8\uc744 \ub54c \uc2e4\ubb34\uc801\uc73c\ub85c \uc870\uae08 \ub354 \uc644\uc804\ud558\uac8c \ud0c0\uc785\uc2a4\ud06c\ub9bd\ud2b8\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc744 \uac83 \uac19\uc740 \uae30\ub300\uac10\uc774 \uc0dd\uacbc\ub2e4."},{"id":"05-makeing-good-use-of-types","metadata":{"permalink":"/studyblog/blog/05-makeing-good-use-of-types","editUrl":"https://github.com/vdcruxfrontend/studyblog/tree/main/blog/chapter5.mdx","source":"@site/blog/chapter5.mdx","title":"5\uc7a5. \ud0c0\uc785 \ud65c\uc6a9\ud558\uae30","description":"extends\uc640 \uc81c\ub108\ub9ad\uc744 \ud65c\uc6a9\ud55c \uc870\uac74\ubd80 \ud0c0\uc785","date":"2024-04-23T23:19:39.000Z","formattedDate":"2024\ub144 4\uc6d4 23\uc77c","tags":[{"label":"extends","permalink":"/studyblog/blog/tags/extends"},{"label":"infer","permalink":"/studyblog/blog/tags/infer"},{"label":"NonNullable","permalink":"/studyblog/blog/tags/non-nullable"},{"label":"ReturnType","permalink":"/studyblog/blog/tags/return-type"},{"label":"Record","permalink":"/studyblog/blog/tags/record"}],"readingTime":3.275,"hasTruncateMarker":false,"authors":[{"name":"\uc131\uc740\uc9c0","title":"Front End Engineer @VDCrux","url":"https://github.com/hotbreakb","imageURL":"https://github.com/hotbreakb.png","key":"hotbreakb"}],"frontMatter":{"slug":"05-makeing-good-use-of-types","title":"5\uc7a5. \ud0c0\uc785 \ud65c\uc6a9\ud558\uae30","authors":["hotbreakb"],"tags":["extends","infer","NonNullable","ReturnType","Record"]},"unlisted":false,"prevItem":{"title":"4\uc7a5. \ud0c0\uc785 \ud655\uc7a5\ud558\uae30, \uc881\ud788\uae30","permalink":"/studyblog/blog/04-type-extends-guard"},"nextItem":{"title":"8\uc7a5. JSX\uc5d0\uc11c TSX\ub85c","permalink":"/studyblog/blog/08-jsx-to-tsx"}},"content":"### extends\uc640 \uc81c\ub108\ub9ad\uc744 \ud65c\uc6a9\ud55c \uc870\uac74\ubd80 \ud0c0\uc785\\n\\n**\ud83d\udd0d \ub0b4\uc6a9 (151\ucabd)**\\n\\n- `PayMethod` \ud0c0\uc785\uc740 \uc81c\ub108\ub9ad \ud0c0\uc785\uc73c\ub85c `extends`\ub97c \uc0ac\uc6a9\ud55c \uc870\uac74\ubd80 \ud0c0\uc785\uc774\ub2e4.\\n\\n```ts\\ntype PayMethod<T> = T extends \\"card\\" ? Card : Bank;\\n```\\n\\n**\ud83c\udf89 \uc774\ub807\uac8c \uac1c\uc120\ud558\uba74 \uc5b4\ub5a8\uae4c\uc694?**\\n\\n```ts\\n// \uc804\\nexport type PointInfo = {\\n  saleAmount: number;\\n  saleProducts: string;\\n  saleType: SaleType;\\n  savePoint: number;\\n  saveStamp: number;\\n  type: string;\\n  usePoint: number;\\n  useStamp: number;\\n  visitedAt: string;\\n};\\n\\n// \ud6c4\\ntype SaleType = \\"point\\" | \\"stamp\\";\\n\\ntype BasePointInfo<T extends SaleType> = {\\n  saleAmount: number;\\n  saleProducts: string;\\n  saleType: T;\\n  visitedAt: string;\\n};\\n\\ntype PointInfoExtended<T extends SaleType> = BasePointInfo<T> & {\\n  type: T;\\n  savePoint: T extends \\"point\\" ? number : 0;\\n  usePoint: T extends \\"point\\" ? number : 0;\\n  saveStamp: T extends \\"stamp\\" ? number : 0;\\n  useStamp: T extends \\"stamp\\" ? number : 0;\\n};\\n\\n// point \ud0c0\uc785\uc758 \uc608\uc2dc\\nconst pointInfo: PointInfoExtended<\\"point\\"> = {\\n  saleAmount: 100,\\n  saleProducts: \\"Product A\\",\\n  saleType: \\"point\\",\\n  savePoint: 10,\\n  usePoint: 20,\\n  saveStamp: 0,\\n  useStamp: 0,\\n  type: \\"point\\",\\n  visitedAt: \\"2024-03-14\\",\\n};\\n```\\n\\n### infer\ub97c \ud65c\uc6a9\ud574\uc11c \ud0c0\uc785 \ucd94\ub860\ud558\uae30\\n\\n**\ud83d\udd0d \ub0b4\uc6a9 (156\ucabd)**\\n\\n- `extends`\ub97c \uc0ac\uc6a9\ud560 \ub54c `infer` \ud0a4\uc6cc\ub4dc\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4. `infer`\ub294 \'\ucd94\ub860\ud558\ub2e4\'\ub77c\ub294 \uc758\ubbf8\ub97c \uc9c0\ub2c8\uace0 \uc788\ub294\ub370 \ud0c0\uc785\uc2a4\ud06c\ub9bd\ud2b8\uc5d0\uc11c\ub3c4 \ub2e8\uc5b4 \uc758\ubbf8\ucc98\ub7fc \ud0c0\uc785\uc744 \ucd94\ub860\ud558\ub294 \uc5ed\ud560\uc744 \ud55c\ub2e4.\\n\\n**\ud83c\udf89 \uc608\uc2dc**\\n\\n```ts\\ntype ReturnType<T extends (...args: any) => any> = T extends (\\n  ...args: any\\n) => infer R\\n  ? R\\n  : any;\\n```\\n\\n    \ud568\uc218 \ub9ac\ud134 \ud0c0\uc785\uc774 \uc788\uc5b4? \uc788\uc73c\uba74 \uadf8\uac70, \uc5c6\uc73c\uba74 `any`\\n\\n**\ud83d\udd0d \ub0b4\uc6a9 (159\ucabd)**\\n\\n- `menuList`\uc5d0\uc11c `subMenus`\uac00 \uc5c6\ub294 `MainMenu`\uc758 `name`\uacfc `subMenus`\uc5d0\uc11c \uc4f0\uc774\ub294 `name`, `route name`\uc5d0 \ub3d9\uc77c\ud55c \ubb38\uc790\uc5f4\ub9cc \uc785\ub825\ud574\uc57c \ud55c\ub2e4\ub294 \uc81c\uc57d\uc774 \uc874\uc7ac\ud55c\ub2e4.\\n  - \ucf54\ub4dc\ub85c \uc791\uc131\ud574\ubcf4\uc558\uc744 \ub54c \uc544\ubb34 \ubb38\uc81c\uac00 \uc548 \uc0dd\uae30\ub294\ub370, \uc5ec\uae30\uc11c \uc5b4\ub5a4 \uc81c\uc57d\uc774 \uc788\ub2e4\uace0 \ud558\ub294 \uac78\uae4c\uc694?\\n\\n### PickOne \ucee4\uc2a4\ud140 \uc720\ud2f8\ub9ac\ud2f0 \ud0c0\uc785 \uad6c\ud604\ud558\uae30\\n\\n**\ud83d\udd0d \ub0b4\uc6a9 (168\ucabd)**\\n\\n- \uc635\uc154\ub110 + `undefined`\ub85c \ud0c0\uc785\uc744 \uc9c0\uc815\ud558\uba74 \uc0ac\uc6a9\uc790\uac00 \uc758\ub3c4\uc801\uc73c\ub85c `undefined` \uac12\uc744 \ub123\uc9c0 \uc54a\ub294 \uc774\uc0c1, \uc6d0\uce58 \uc54a\ub294 \uc18d\uc131\uc5d0 \uac12\uc744 \ub123\uc5c8\uc744 \ub54c \ud0c0\uc785 \uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud560 \uac83\uc774\ub2e4.\\n\\n```ts\\n{ account: string; card?: undefined} | { account?: undefined; card: string}\\n```\\n\\n### Promise.all\uc744 \uc0ac\uc6a9\ud560 \ub54c NonNullable \uc801\uc6a9\ud558\uae30\\n\\n**\ud83d\udd0d \ub0b4\uc6a9 (172\ucabd)**\\n\\n- `Array<AdCampaign[] | null>`\ub85c \ucd94\ub860\ub41c\ub2e4. `NonNullable`\uc744 \uc0ac\uc6a9\ud574\uc11c \ud544\ud130\ub9c1\ud558\uba74 `Array<AdCampaign[]>`\ub85c \ucd94\ub860\ud560 \uc218 \uc788\uac8c \ub41c\ub2e4.\\n\\n### \ubb34\ud55c\ud55c \ud0a4\ub97c \uc9d1\ud569\uc73c\ub85c \uac00\uc9c0\ub294 Record\\n\\n**\ud83d\udd0d \ub0b4\uc6a9 (179\ucabd)**\\n\\n```ts\\ntype Category = string;\\nconst foodByCategory: Record<Category, Food[]> = {\\n  \ud55c\uc2dd: [{ name: \\"\uc81c\uc721\ub36e\ubc25\\" }, { name: \\"\ucf69\ub098\ubb3c\uad6d\ubc25\\" }],\\n  \uc77c\uc2dd: [{ name: \\"\ud68c\\", name: \\"\ud150\ub3d9\\" }],\\n};\\n\\nfoodByCategory[\\"\uc591\uc2dd\\"].map((food) => food.name); // \ub7f0\ud0c0\uc784\uc5d0\uc11c undefined\uac00 \ub418\uc5b4 \uc624\ub958 \ubc18\ud658\\n```\\n\\n```ts\\ntype PartialRecord<K extends string, T> = Partial<Record<K, T>>;\\n\\nconst foodByCategory: PartialRecord<Category, Food[]> = {\\n  \ud55c\uc2dd: [{ name: \\"\uc81c\uc721\ub36e\ubc25\\" }, { name: \\"\ucf69\ub098\ubb3c\uad6d\ubc25\\" }],\\n  \uc77c\uc2dd: [{ name: \\"\ud68c\\", name: \\"\ud150\ub3d9\\" }],\\n};\\n\\nfoodByCategory[\\"\uc591\uc2dd\\"].map((food) => food.name); // Object is possibly `undefined`\\n```"},{"id":"08-jsx-to-tsx","metadata":{"permalink":"/studyblog/blog/08-jsx-to-tsx","editUrl":"https://github.com/vdcruxfrontend/studyblog/tree/main/blog/chapter8.mdx","source":"@site/blog/chapter8.mdx","title":"8\uc7a5. JSX\uc5d0\uc11c TSX\ub85c","description":"1. \ud074\ub798\uc2a4 \ucef4\ud3ec\ub10c\ud2b8 \ud0c0\uc785","date":"2024-04-23T23:19:39.000Z","formattedDate":"2024\ub144 4\uc6d4 23\uc77c","tags":[{"label":"tsx","permalink":"/studyblog/blog/tags/tsx"}],"readingTime":12.15,"hasTruncateMarker":false,"authors":[{"name":"\uace0\ud604\uc218","title":"Front End Engineer @VDCrux","url":"https://github.com/movie42","imageURL":"https://github.com/movie42.png","key":"hyunsu"}],"frontMatter":{"slug":"08-jsx-to-tsx","title":"8\uc7a5. JSX\uc5d0\uc11c TSX\ub85c","authors":["hyunsu"],"tags":["tsx"]},"unlisted":false,"prevItem":{"title":"5\uc7a5. \ud0c0\uc785 \ud65c\uc6a9\ud558\uae30","permalink":"/studyblog/blog/05-makeing-good-use-of-types"}},"content":"## 1. \ud074\ub798\uc2a4 \ucef4\ud3ec\ub10c\ud2b8 \ud0c0\uc785\\n\\n```ts\\ninterface Component<P = {}, S = {}, SS = any>\\n  extends ComponentLifecycle<P, S, SS> {}\\nclass Component<P, S> {\\n  /* \uc0dd\ub7b5 */\\n}\\nclass PureComponent<P = {}, S = {}, SS = any> extends Component<P, S, SS> {}\\n```\\n\\n- P, S\ub294 props\uc640 \uc0c1\ud0dc\ub97c \uc758\ubbf8\\n- props\uc640 state\ub97c \uc81c\ub124\ub9ad\uc73c\ub85c \ubc1b\uace0 \uc788\ub2e4.\\n\\n```ts\\ninterface WorkerProps {\\n  authrization: string;\\n}\\n\\nclass Worker extends React.Component<WorkerProps> {}\\n```\\n\\n## 2. \ud568\uc218 \ucef4\ud3ec\ub10c\ud2b8 \ud0c0\uc785\\n\\n- \ub9ac\uc561\ud2b8 v18\uc5d0\uc11c React.VFC\uac00 \uc0ad\uc81c\ub418\uc5c8\ub2e4.\\n- React.FC\uc5d0\uc11c children\uc774 \uc0ac\ub77c\uc84c\ub2e4.\\n\\n```ts\\ninterface Workder {\\n  authrization: string;\\n}\\nconst Worker = ({ authrization }: Worker) => {};\\n```\\n\\n## 3. Children props \ud0c0\uc785 \uc9c0\uc815\\n\\n```ts\\ntype PropsWithChildren<P> = P & { children?: ReactNode | undefined };\\n```\\n\\n- ReactNode\ub294 ReactElement\uc678\uc5d0\ub3c4 boolean, number \ub4f1 \uc5ec\ub7ec \ud0c0\uc785\uc744 \ud3ec\ud568\ud558\uace0 \uc788\ub294 \ud0c0\uc785\uc774\ub2e4.\\n  - \ub354 \uad6c\uccb4\uc801\uc73c\ub85c \ud0c0\uc774\ud551 \ud558\ub294 \uc6a9\ub3c4\ub85c\ub294 \uc801\ud569\ud558\uc9c0 \uc54a\ub2e4.\\n  - \ud2b9\uc815 \ubb38\uc790\uc5f4\ub9cc \ud5c8\uc6a9\ud558\uace0 \uc2f6\ub2e4\uba74 \uad6c\uccb4\uc801\uc73c\ub85c \ud0c0\uc785\uc744 \uc9c0\uc815\ud558\uba74 \ub41c\ub2e4.\\n\\n```ts\\n//example 1\\ntype FrontendWorkerProps = {\\n  children: \\"\uc5c4\ubb38\uc8fc\\" | \\"\uc131\uc740\uc9c0\\" | \\"\uace0\ud604\uc218\\" | \\"\ubc15\uc724\uad6d\\";\\n};\\n//example 2\\ntype FrontendWorkerProps = {\\n  children: string;\\n};\\n//example 3\\ntype FrontendWorkerProps = {\\n  children: ReactElement;\\n};\\n```\\n\\n## 4. render \uba54\uc11c\ub4dc\uc640 \ud568\uc218 \ucef4\ud3ec\ub10c\ud2b8\uc758 \ubc18\ud658 \ud0c0\uc785 - React.ReactElement vs JSX.Element vs React.ReactNode\\n\\n### ReactElement\\n\\n- \ud568\uc218 \ucef4\ud3ec\ub10c\ud2b8\uc758 \ubc18\ud658 \ud0c0\uc785\uc774\ub2e4.\\n\\n```ts\\ninterface ReactElement<P = any, T extends string | JSXElementConstructor<any> = string|JSXElementConstructor<any>{\\n   type: T;\\n   props: P;\\n   key: Key | null;\\n}\\n```\\n\\n- React.createElement\ub97c \ud638\ucd9c\ud558\ub294 \ud615\ud0dc\uc758 \uad6c\ubb38\uc73c\ub85c \ubcc0\ud658\ud558\uba74 React.createElement\uc758 \ubc18\ud658 \ud0c0\uc785\uc740 ReactElement\uc774\ub2e4.\\n- \uac00\uc0c1 DOM\uc758 \uc5d8\ub9ac\uba3c\ud2b8\ub294 ReactElement\uc758 \ud615\ud0dc\ub85c \uc800\uc7a5\ub41c\ub2e4.\\n- **ReactElement\ud0c0\uc785\uc740 \ub9ac\uc561\ud2b8 \ucef4\ud3ec\ub10c\ud2b8\ub97c \uac1d\uccb4 \ud615\ud0dc\ub85c \uc800\uc7a5\ud558\uae30 \uc704\ud55c \ud3ec\uba67\uc774\ub2e4.**\\n- JSX\ub294 createElement \uba54\uc11c\ub4dc\ub97c \ud638\ucd9c\ud558\uae30 \uc704\ud55c \ubb38\ubc95\uc774\ub2e4. JSX\ub294 \ub9ac\uc561\ud2b8 \uc5d8\ub9ac\uba3c\ud2b8\ub97c \uc0dd\uc131\ud558\uae30 \uc704\ud55c \ubb38\ubc95\uc774\uba70 \ud2b8\ub79c\uc2a4\ud30c\uc77c\ub7ec\ub294 JSX \ubb38\ubc95\uc744 createElement \uba54\uc11c\ub4dc \ud638\ucd9c\ubb38\uc73c\ub85c \ubcc0\ud658\ud558\uc5ec \ub9ac\uc561\ud2b8 \uc5d8\ub9ac\uba3c\ud2b8\ub97c \uc0dd\uc131\ud55c\ub2e4.\\n\\n```ts\\nconst element = React.createElement(\\n  \\"h1\\",\\n  { className: \\"greeting\\" },\\n  \\"Hello, world!\\"\\n);\\n```\\n\\n- \ub9ac\uc561\ud2b8\ub294 \ub9ac\uc561\ud2b8 \uc5d8\ub9ac\uba3c\ud2b8 \uac1d\uccb4\ub97c \uc77d\uc5b4\uc11c DOM\uc744 \uad6c\uc131\ud55c\ub2e4.\\n- \ub9ac\uc561\ud2b8\uc5d0\ub294 \uc5ec\ub7ec \uac1c\uc758 createElement \uc624\ubc84\ub77c\uc774\ub529 \uba54\uc11c\ub4dc\uac00 \uc874\uc7ac\ud558\uace0, \uc774 \ub9e4\uc11c\ub4dc\ub4e4\uc774 \ubc18\ud658\ud558\ub294 \ud0c0\uc785\uc740 ReactElement \ud0c0\uc785\uc744 \uae30\ubc18\uc73c\ub85c \ud55c\ub2e4.\\n- \uc815\ub9ac : ReactElement \ud0c0\uc785\uc740 JSX\uc758 createElement \uba54\uc11c\ub4dc \ud638\ucd9c\ub85c \uc0dd\uc131\ub41c \ub9ac\uc561\ud2b8 \uc5d8\ub9ac\uba3c\ud2b8\ub97c \ub098\ud0c0\ub0b4\ub294 \ud0c0\uc785\uc774\ub2e4.\\n\\n#### \uc0ac\uc6a9 \uc608\uc2dc\\n\\n- \ucd94\ub860 \uad00\uc810\uc5d0\uc11c \ub354 \uc720\uc6a9\ud558\uac8c \ud65c\uc6a9\ud560 \uc218 \uc788\ub294 \ubc29\ubc95\uc740 JSX.Element \ub300\uc2e0 ReactElement\ub97c \uc0ac\uc6a9\ud558\ub294 \uac83\uc774\ub2e4.\\n\\n```tsx\\ninterface IconProps {\\n  size: number;\\n}\\ninterface Props {\\n  // ReactElement\uc758 props \ud0c0\uc785\uc73c\ub85c IconProps \ud0c0\uc785 \uc9c0\uc815\\n  icon: React.ReactElement<IconProps>;\\n}\\nconst Item = ({ icon }: Props) => {\\n  // icon prop\uc73c\ub85c \ubc1b\uc740 \ucef4\ud3ec\ub10c\ud2b8\uc758 props\uc5d0 \uc811\uadfc\ud558\uba74, props\uc758 \ubaa9\ub85d\uc774 \ucd94\ub860\ub41c\ub2e4.\\n  const iconSize = icon.props.size;\\n  reutnr(<li>{icon}</li>);\\n};\\n```\\n\\n### JSX.Element\\n\\n- JSX.Element \ud0c0\uc785\uc740 \ub9ac\uc561\ud2b8\uc758 ReactElement\ub97c \ud655\uc7a5\ud558\uace0 \uc788\ub294 \ud0c0\uc785\uc774\ub2e4.\\n- \uae00\ub85c\ubc8c \ub124\uc784\uc2a4\ud398\uc774\uc2a4\uc5d0 \uc815\uc758\ub418\uc5b4 \uc788\uc5b4 \uc678\ubd80 \ub77c\uc774\ube0c\ub7ec\ub9ac\uc5d0\uc11c \ucef4\ud3ec\ub10c\ud2b8 \ud0c0\uc785\uc744 \uc7ac\uc815\uc758 \ud560 \uc218 \uc788\ub294 \uc720\uc5f0\uc131\uc744 \uc81c\uacf5\ud55c\ub2e4.\\n\\n> [!NOTE]\\n> \uae00\ub85c\ubc8c \ub124\uc784\uc2a4\ud398\uc774\uc2a4\\n> \uc2dd\ubcc4\uc790\uac00 \uc815\uc758\ub418\ub294 \uc804\uc5ed\uc801\uc778 \ubc94\uc704\ub97c \ub9d0\ud55c\ub2e4.\\n> \uc5b4\ub290\uacf3\uc5d0\uc11c\ub4e0\uc9c0 \uc811\uadfc\ud560 \uc218 \uc788\ub2e4.\\n> \uc790\ubc14\uc2a4\ud06c\ub9bd\ud2b8, \ud0c0\uc785\uc2a4\ud06c\ub9bd\ud2b8\uc5d0\uc11c\ub294 \uae30\ubcf8\uc801\uc73c\ub85c \uc804\uc5ed(\uae00\ub85c\ubc8c) \uc2a4\ucf54\ud504\uc5d0\uc11c \uc120\uc5b8\ub41c \ubcc0\uc218\ub098 \ud568\uc218 \ub4f1\uc740 \uae00\ub85c\ubc8c \ub124\uc784\uc2a4\ud398\uc774\uc2a4\uc5d0 \uc18d\ud55c\ub2e4.\\n\\n```ts\\ndeclare global {\\n  namespace JSX {\\n    interface Element extends React.ReactElement<any, any> {}\\n  }\\n}\\n```\\n\\n- props\uc640 \ud0c0\uc785 \ud544\ub4dc\uc5d0 \ub300\ud574 any \ud0c0\uc785\uc744 \uac00\uc9c0\ub3c4\ub85d \ud655\uc7a5\ud558\uace0 \uc788\ub2e4.\\n\\n#### \uc0ac\uc6a9\uc608\uc2dc\\n\\n- props\uc640 \ud0c0\uc785 \ud544\ub4dc\uac00 any \ud0c0\uc785\uc778 \ub9ac\uc561\ud2b8 \uc5d8\ub9ac\uba3c\ud2b8\ub97c \ub098\ud0c0\ub0b8\ub2e4. \uadf8\ub798\uc11c \ub9ac\uc561\ud2b8 \uc5d8\ub9ac\uba3c\ud2b8\ub97c prop\uc73c\ub85c \uc804\ub2ec\ubc1b\uc544 render props \ud328\ud134\uc73c\ub85c \ucef4\ud3ec\ub10c\ud2b8\ub97c \uad6c\ud604\ud560 \ub54c \uc720\uc6a9\ud558\uac8c \ud65c\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n```tsx\\ninterface Props {\\n  icon: JSX.Element;\\n}\\nconst Item = ({ icon }: Props) => {\\n  // prop\uc73c\ub85c \ubc1b\uc740 \ucef4\ud3ec\ub10c\ud2b8\uc758 props\uc5d0 \uc811\uadfc\ud560 \uc218 \uc788\ub2e4.\\n  const iconSize = icon.props.size;\\n\\n  return <li>{icon}</li>;\\n};\\n\\n// icon prop\uc5d0\ub294 JSX.Element \ud0c0\uc785\uc744 \uac00\uc9c4 \uc694\uc18c\ub9cc \ud560\ub2f9\ud560 \uc218 \uc788\ub2e4.\\nconst App = () => {\\n  return <Item icon={<Icon size={14} />} />;\\n};\\n```\\n\\n- JSX \ubb38\ubc95\ub9cc \uc0bd\uc785\ud560 \uc218 \uc788\uac8c \ub41c\ub2e4.\\n- icon.props\uc5d0 \uc811\uadfc\ud558\uc5ec prop\uc73c\ub85c \ub118\uaca8\ubc1b\uc740 \ucef4\ud3ec\ub10c\ud2b8\uc758 \uc0c1\uc138\ud55c \ub370\uc774\ud130\ub97c \uac00\uc838\uc62c \uc218 \uc788\ub2e4.\\n\\n### ReactNode\\n\\n```ts\\ntype ReactText = string | number;\\ntype ReactChild = ReactElement | ReactText;\\ntype ReactFragment = {} | Iterable<ReactNode>; // ReactNode\uc758 \ubc30\uc5f4 \ud615\ud0dc\\n\\ntype ReactNode =\\n  | ReactChild\\n  | ReactFragment\\n  | ReactPortal\\n  | boolean\\n  | null\\n  | undefined;\\n```\\n\\n- ReactElement \uc678\uc5d0\ub3c4 boolean, string, number \ub4f1\uc758 \uc5ec\ub7ec \ud0c0\uc785\uc744 \ud3ec\ud568\ud558\uace0 \uc788\ub2e4.\\n- ReactChild \ud0c0\uc785\uc740 ReactElement | string | number\ub85c \uc815\uc758\ub418\uc5b4 ReactElement\ubcf4\ub2e4\ub294 \uc880 \ub354 \ub113\uc740 \ubc94\uc704\ub97c \uac16\uace0 \uc788\ub2e4.\\n- **ReactNode\ub294 \ub9ac\uc561\ud2b8\uc758 render \ud568\uc218\uac00 \ubc18\ud658\ud560 \uc218 \uc788\ub294 \ubaa8\ub4e0 \ud615\ud0dc\ub97c \ub2f4\uace0 \uc788\ub2e4.**\\n\\n#### \uc0ac\uc6a9 \uc608\uc2dc\\n\\n- \ub9ac\uc561\ud2b8\uc758 Composition(\ud569\uc131) \ubaa8\ub378\uc744 \ud65c\uc6a9\ud558\uae30 \uc704\ud574 prop\uc73c\ub85c children\uc744 \ub9ce\uc774 \uc0ac\uc6a9\ud55c\ub2e4.\\n\\n```ts\\ninterface ExampleProps {\\n  children: React.ReactNode;\\n}\\n```\\n\\n- \uc5b4\ub5a4 \ud615\ud0dc\ub4e0 children props\ub85c \uc9c0\uc815\ud558\uace0 \uc2f6\ub2e4\uba74 ReactNode\ub97c \uc0ac\uc6a9\ud558\uba74 \ub41c\ub2e4.\\n\\n### \ud3ec\ud568\uad00\uacc4(\uacb0\ub860)\\n\\n- ReactNode > ReactElement > JSX.Element\\n\\n## 5. \ub9ac\uc561\ud2b8\uc5d0\uc11c \uae30\ubcf8 HTML \uc694\uc18c \ud0c0\uc785 \ud65c\uc6a9\ud558\uae30\\n\\n### DetailedHTMLProps\uc640 ComponentWithoutRef\\n\\n#### DetailedHTMLProps\ub97c \ud65c\uc6a9\\n\\n```ts\\ntype NativeButtonProps = React.DetailedHTMLProps<\\n  React.ButtonHTMLAttributes<HTMLButtonElement>,\\n  HTMLButtonElement\\n>;\\ntype ButtonProps = {\\n  onClick?: NativeButtonProps[\\"onClick\\"];\\n};\\n```\\n\\n#### ComponentWithoutRef\\n\\n```ts\\ntype NativeButtonType = React.ComponentPropsWithoutRef<\\"button\\">;\\ntype ButtonProps = {\\n  onClick?: NativeButtonType[\\"onClick\\"];\\n};\\n```\\n\\n- \uc5b8\uc81c \uc0ac\uc6a9\ud560\uae4c?\\n  - \ud568\uc218 \ucef4\ud3ec\ub10c\ud2b8\uc758 \uacbd\uc6b0 \ud074\ub798\uc2a4 \ucef4\ud3ec\ub10c\ud2b8\uc640 \ub2e4\ub974\uac8c \uc804\ub2ec\ubc1b\uc740 ref\uac00 Button \ucef4\ud3ec\ub10c\ud2b8\uc758 button \ud0dc\uadf8\ub97c \ubc14\ub77c\ubcf4\uc9c0 \uc54a\ub294\ub2e4.\\n\\n```tsx\\ncosnt WrapperButton = () =>{\\n\\tconst buttonRef = useRef();\\n\\treturn (\\n\\t\\t<div>\\n\\t\\t\\t<Button ref={buttonRef} />\\n\\t\\t</div>\\n\\t)\\n}\\n```\\n\\n- \ud074\ub798\uc2a4 \ucef4\ud3ec\ub10c\ud2b8\uc5d0\uc11c ref \uac1d\uccb4\ub294 \ub9c8\uc6b4\ud2b8\ub41c \ucef4\ud3ec\ub10c\ud2b8\uc758 \uc778\uc2a4\ud134\uc2a4\ub97c current \uc18d\uc131\uac12\uc73c\ub85c \uac00\uc9c0\uc9c0\ub9cc, \ud568\uc218 \ucef4\ud3ec\ub10c\ud2b8\uc5d0\uc11c\ub294 \uc0dd\uc131\ub41c \uc778\uc2a4\ud134\uc2a4\uac00 \uc5c6\uae30 \ub54c\ubb38\uc5d0 ref\uc5d0 \uae30\ub300\ud55c \uac12\uc774 \ud560\ub2f9\ub418\uc9c0 \uc54a\ub294\ub2e4.\\n- forwardRef\ub294 \uc774\ub7f0 \uc81c\uc57d\uc744 \uadf9\ubcf5\ud558\uac8c \ud574\uc900\ub2e4.\\n\\n```tsx\\nconst Button = forwardRef((props, ref)=>{\\n\\treturn <button ref={ref} {...props}>\ubc84\ud2bc</button>\\n})\\n\\ncosnt WrapperButton = () =>{\\n\\tconst buttonRef = useRef();\\n\\treturn (\\n\\t\\t<div>\\n\\t\\t\\t<Button ref={buttonRef} />\\n\\t\\t</div>\\n\\t)\\n}\\n```\\n\\n- forwardRef\ub294 2\uac1c\uc758 \uc81c\ub124\ub9ad \uc778\uc790\ub97c \ubc1b\uc744 \uc218 \uc788\ub2e4. \uccab \ubc88\uc9f8\ub294 ref\uc5d0 \ub300\ud55c \ud0c0\uc785 \uc815\ubcf4, \ub450\ubc88\uc9f8\ub294 props\uc5d0 \ub300\ud55c \ud0c0\uc785 \uc815\ubcf4\ub2e4.\\n\\n```tsx\\ntype NativeButtonType = React.ComponentPropsWithoutRef<\\"button\\">;\\n\\nconst Button = forwardRef<HTMLButtonElement, NativeButtonType>((props, ref) => {\\n  return (\\n    <button ref={ref} {...props}>\\n      \ubc84\ud2bc\\n    </button>\\n  );\\n});\\n```\\n\\n- `ComponentPropsWIthoutRef<\\"button\\">` \ud0c0\uc785\uc740 button \ud0dc\uadf8\uc5d0 \ub300\ud55c HTML \uc18d\uc131\uc744 \ubaa8\ub450 \ud3ec\ud568\ud558\uc9c0\ub9cc, ref \uc18d\uc131\uc740 \uc81c\uc678\ub41c\ub2e4.\\n\\n# 8.2 \ud0c0\uc785\uc2a4\ud06c\ub9bd\ud2b8\ub85c \ub9ac\uc561\ud2b8 \ucef4\ud3ec\ub10c\ud2b8 \ub9cc\ub4e4\uae30\\n\\n## \ub9ac\uc561\ud2b8 \uc774\ubca4\ud2b8\\n\\n- \ub9ac\uc561\ud2b8\ub294 \uac00\uc0c1 DOM\uc744 \ub2e4\ub8e8\uba74\uc11c \uc774\ubca4\ud2b8\ub3c4 \ubcc4\ub3c4\ub85c \uad00\ub9ac\ud55c\ub2e4.\\n- \ub9ac\uc561\ud2b8 \uc774\ubca4\ud2b8\ub294 \ube0c\ub77c\uc6b0\uc800\uc758 \uace0\uc720\ud55c \uc774\ubca4\ud2b8\uc640 \uc644\uc804\ud788 \ub3d9\uc77c\ud558\uac8c \ub3d9\uc791\ud558\uc9c0 \uc54a\ub294\ub2e4. \uc608\ub97c \ub4e4\uc5b4 \ub9ac\uc561\ud2b8 \uc774\ubca4\ud2b8 \ud578\ub4e4\ub7ec\ub294 \uc774\ubca4\ud2b8 \ubc84\ube14\ub9c1 \ub2e8\uacc4\uc5d0\uc11c \ud638\ucd9c\ub41c\ub2e4.\\n- Capture \ub2e8\uacc4\uc5d0\uc11c \uc774\ubca4\ud2b8 \ud638\ucd9c\uc744 \ud558\ub824\uba74 onClickCapture\uc640 \uac19\uc774 Capture\ub97c \ubd99\uc5ec\uc57c\ud55c\ub2e4.\\n- \ub9ac\uc561\ud2b8\ub294 \ube0c\ub77c\uc6b0\uc800 \uc774\ubca4\ud2b8\ub97c \ud569\uc131\ud55c \ud569\uc131 \uc774\ubca4\ud2b8\ub97c \uc81c\uacf5\ud55c\ub2e4.\\n\\n```ts\\ntype EventHandler<Event extends React.SyntheticEvent> = (\\n  e: Event\\n) => void | null;\\ntype ChangeEventHandler = EventHandler<ChangeEvent<HTMLSelectElement>>;\\n\\nconst eventHandler1: GlobalEventHandlers[\\"onchange\\"] = (e) => {\\n  e.target; // \uc77c\ubc18 Event\ub294 target\uc774 \uc5c6\uc74c.\\n};\\nconst eventHandler2: ChangeEventHandler = (e) => {\\n  e.target; // \ub9ac\uc561\ud2b8 \uc774\ubca4\ud2b8(\ud569\uc131 \uc774\ubca4\ud2b8)\ub294 target\uc774 \uc788\ub2e4.\\n};\\n```\\n\\n## currentTarget\uacfc target\uc758 \ucc28\uc774\\n\\n- ChangeEventHandler -> target\\n- ChangeEvent -> currentTarget\\n\\n## \uc81c\ub124\ub9ad \ucef4\ud3ec\ub10c\ud2b8 \ub9cc\ub4e4\uae30\\n\\n- Select\ub97c \uc0ac\uc6a9\ud558\ub294 \uc785\uc7a5\uc5d0\uc11c \uc81c\ud55c\ub41c \ud0a4(key)\uc640 \uac12(value)\ub9cc\uc744 \uac00\uc9c0\ub3c4\ub85d \ud558\ub824\uba74 \uc5b4\ub5bb\uac8c \ud574\uc57c\ud560\uae4c? \ud568\uc218 \ucef4\ud3ec\ub10c\ud2b8\ub3c4 \ud568\uc218\uc774\uae30 \ub54c\ubb38\uc5d0 \uc81c\ub124\ub9ad\uc744 \uc0ac\uc6a9\ud55c \ucef4\ud3ec\ub10c\ud2b8\ub97c \ub9cc\ub4e4\uc5b4\ub0bc \uc218 \uc788\ub2e4.\\n\\n```tsx\\ninterface SelectProps<OptionType extends Record<string, string>> {\\n  options: OptionType;\\n  selectedOption?: keyof OptionType;\\n  onChange?: (selected?: keyof OptionType) => void;\\n}\\n\\nconst Select = <OptionType extends Record<string, string>>({\\n  options,\\n  selectedOption,\\n  onChange\\n}: SelectProps<OptionType>) => {\\n  const handleChange = (e) => {\\n    const selected = Object.entries(options).find(\\n      ([_, value]) => value === e.target.value\\n    )?.[0];\\n    onChange?.(selected);\\n  };\\n\\n  return (\\n    <select\\n      onChange={handleChange}\\n      value={selectedOption && options[selectedOption]}\\n    >\\n      {Object.entries(options).map(([key, value]) => (\\n        <option key={key} value={value}>\\n          {value}\\n        </option>\\n      ))}\\n    </select>\\n  );\\n};\\n\\nconst fruits = {\\n  apple: \\"\uc0ac\uacfc\\",\\n  banana: \\"\ubc14\ub098\ub098\\",\\n  blueberry: \\"\ube14\ub8e8\ubca0\ub9ac\\"\\n};\\n\\ntype Fruit = keyof typeof fruits;\\n\\nconst FruitSelect = () => {\\n  const [, changeFruit] = useState<Fruit | undefined>();\\n  return (\\n    // Type \'\\"orange\\"\' is not assignable to type \'\\"apple\\" | \\"banana\\" | \\"blueberry\\" | undefined\'.ts(2322)\\n    <Select options={fruits} onChange={changeFruit} selectedOption=\\"orange\\" />\\n  );\\n};\\n```\\n\\n## \uacf5\ubcc0\uc131 \ubc18\uacf5\ubcc0\uc131\\n\\n```tsx\\ninterface Props<T extends string> {\\n  onChangeA?: (selected: T) => void;\\n  onChangeB?(selected: T): void;\\n}\\n\\nconst Component = () => {\\n  const changeToPineApple = (selectedApple: \\"apple\\") => {\\n    console.log(\\"this is pine\\" + selectedApple);\\n  };\\n  return (\\n    <Select\\n      //Error\\n      // onChangeA={changeToPineApple}\\n      //OK\\n      onChangeB={changeToPineApple}\\n    />\\n  );\\n};\\n```\\n\\n- \ud0c0\uc785 A\uac00 B\uc758 \uc11c\ube0c\ud0c0\uc785\uc77c \ub54c, `T<A>`\uac00 `T<B>`\uc758 \uc11c\ube0c\ud0c0\uc785\uc774 \ub41c\ub2e4\uba74 \uacf5\ubcc0\uc131\uc744 \ub744\uace0 \uc788\ub2e4\uace0 \ub9d0\ud55c\ub2e4.\\n- \uc77c\ubc18\uc801\uc73c\ub85c \ud0c0\uc785\ub4e4\uc740 \uacf5\ubcc0\uc131\uc744 \uac00\uc9c0\uace0 \uc788\uc5b4\uc11c **\uc881\uc740 \ud0c0\uc785\uc5d0\uc11c \ub113\uc740 \ud0c0\uc785\uc73c\ub85c \ud560\ub2f9\uc774 \uac00\ub2a5**\ud558\ub2e4.\\n\\n```ts\\n// \ubca0\uc774\uc2a4 \ud0c0\uc785\\ninterface User {\\n  id: string;\\n}\\n\\n// Member\ub294 User\uc758 \uc11c\ube0c \ud0c0\uc785\uc774\ub2e4. User\ub97c \uc0c1\uc18d\ud558\uae30 \ub584\ubb38\uc5d0\\ninterface Member extends User {\\n  // id\ub97c \uac00\uc9c0\uace0 \uc788\ub2e4.\\n  nickName: string;\\n}\\n\\nlet users: Array<User> = [];\\nlet members: Array<Member> = [];\\n// Member\ub294 User\uc5d0 \ub300\ud574 \uacf5\ubcc0\uc131\uc744 \ub744\uace0 \uc788\ub2e4.\\nusers = members;\\nmembers = users; // Error nickName\uc774 \uc5c6\ub2e4.\\n```\\n\\n- \uc81c\ub124\ub9ad \ud0c0\uc785\uc744 \uc9c0\ub2cc \ud568\uc218\ub294 \ubc18\uacf5\ubcc0\uc131\uc744 \uac00\uc9c4\ub2e4. \uc989 `T<B>`\uac00 `T<A>`\uc758 \uc11c\ube0c\ud0c0\uc785\uc774 \ub418\uc5b4, **\uc881\uc740 \ud0c0\uc785 `T<A>`\uc758 \ud568\uc218\ub97c \ub113\uc740 \ud0c0\uc785 `T<B>`\uc758 \ud568\uc218\uc5d0 \uc801\uc6a9\ud560 \uc218 \uc5c6\ub2e4**.\\n\\n```ts\\ntype PrintUserInfo<U extends User> = (user: U) => void;\\nlet printUser: PrintUserInfo<User> = (user) => console.log(user.id);\\nlet printMember: PrintUserInfo<Member> = (user) =>\\n  console.log(user.id, user.nickName);\\n\\nprintMember = printUser;\\nprintUser = printMember;\\n```\\n\\n- User\uac00 Member\ubcf4\ub2e4 \ub113\uc740 \ud0c0\uc785\uc774\ub2e4.\\n- \uc881\uc740 \ud0c0\uc785 Member\ub97c \ub113\uc740 \ud0c0\uc785 User\uc5d0 \ud560\ub2f9\ud560 \uc218 \uc5c6\ub2e4.\\n\\n> \ucc38\uace0\uc790\ub8cc\\n>\\n> [\ubc88\uc5ed \ud0c0\uc785\uc2a4\ud06c\ub9ac\ud2b8\uc758 \uacf5\ubcc0\uc131\uacfc \ubc18\uacf5\ubcc0\uc131](https://medium.com/@yujso66/%EB%B2%88%EC%97%AD-%ED%83%80%EC%9E%85%EC%8A%A4%ED%81%AC%EB%A6%BD%ED%8A%B8%EC%9D%98-%EA%B3%B5%EB%B3%80%EC%84%B1%EA%B3%BC-%EB%B0%98%EA%B3%B5%EB%B3%80%EC%84%B1-82139f7e5cc3)"}]}')}}]);